
    CREATE TABLE IF NOT EXISTS block ( 
     blockNumber BIGINT PRIMARY KEY,
     blockGasUsed NUMERIC, 
     blockHash TEXT, 
     blockLogsBloom TEXT, 
     blockNonce TEXT, 
     difficulty TEXT, 
     extraData TEXT, 
     gasLimit BIGINT, 
     miner TEXT, 
     mixHash TEXT,
     parentHash TEXT, 
     receiptsRoot TEXT, 
     sha3Uncles TEXT, 
     size BIGINT, 
     stateRoot TEXT, 
     timestamp BIGINT, 
     totalDifficulty TEXT, 
     transactionsRoot TEXT, 
     uncles TEXT,
     dollarquote DECIMAL(12,6),
     totalFee NUMERIC DEFAULT null
     );
    

    CREATE TABLE IF NOT EXISTS Quick (
     txHash TEXT PRIMARY KEY,
     balanceFrom TEXT,
     balanceTo TEXT,
     blockNumber BIGINT REFERENCES block(blockNumber), 
     sender TEXT,
     nonce BIGINT, 
     recipient TEXT,
     value TEXT);
    

    CREATE TABLE IF NOT EXISTS TX (
     txHash TEXT PRIMARY KEY,    
     blockNumber BIGINT REFERENCES block(blockNumber),
     contractAddress TEXT,
     cumulativeGasUsed NUMERIC, 
     gas NUMERIC, 
     gasPrice NUMERIC, 
     gasUsed NUMERIC,
     input TEXT, 
     logs TEXT, 
     logsBloom TEXT, 
     r TEXT, 
     s TEXT, 
     status BIGINT, 
     transactionIndex BIGINT, 
     v INTEGER ,
     fee NUMERIC);
           
    CREATE TABLE IF NOT EXISTS account(
     address TEXT PRIMARY KEY,
     balance DECIMAL,
     txCount INTEGER);
    

    
    CREATE TABLE IF NOT EXISTS contract(
     address TEXT PRIMARY KEY);
    
CREATE INDEX index_quick ON Quick(value, sender, recipient);
CREATE INDEX index_TX ON TX(blockNumber, status);
CREATE INDEX index_block ON block(timestamp);
CREATE INDEX index_account ON account(address);
CREATE INDEX index_contract ON contract(address);






